import BaseIcon from '../base/BaseIcon';

const getBase64Data = function(){
    return `data:image/svg+xml;base64,`;
}

/**
 * 图片
 * @param {} props
 * @returns
 */
export default function (props) {
    return (
        <BaseIcon
            {...props}
            icon={`url(${getBase64Data()})`}
        ></BaseIcon>
    );
}

export { getBase64Data };
